import React from 'react';
import { withRoomConsumer } from './Context';
import Loading from './Loading';

const RoomContainer = ({ context }) => {
    const { loading, sortedRoom, rooms } = context;
    console.log(loading)
    if (loading) {
        return <Loading />
    }
    return (
        <div>
            <h1>Hello</h1>
        </div>
    );
};

export default withRoomConsumer(RoomContainer);
